import React from 'react';
import { Button } from './Button.js';
import '../App.css';
import './Panel.css';

function Panel(props) {
    return (
        <div className='panel__container'>
            <div className='panel'>
                <div className='panel__item' style={{ backgroundImage: `url(${props.background})` }}>
                    <div className='panel__item__content'>
                        <h1>BRING YOUR BRAND TO LIFE</h1>
                        <p>It all starts with a stunning website and killer user experience.</p>
                        <div className='hero-btns'>
                            <Button
                                className='btn'
                                buttonStyle='btn--outline'
                                buttonSize='btn--large'
                            >
                                GET STARTED
                            </Button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Panel;
